description:
National Geographic series of documentaries.

&quot;This Tribal Odyssey collection of episodes is based upon character led stories told in their own words. These are real stories about real human dramas, containing narratives repeated throughout every human community in the world. In the film the viewer has a strong sense of 'presence'. You feel that you are actually there and that the stories and relationships that intertwine with the characters are familiar even to Western audiences.&quot;

These videos have embedded subtitles in portuguese because they were taken from a portuguese TV channel.
